Sin dudas uno de los lugares más interesantes por los que pase en todos mis viajes, las Salinas del Gualicho,se encuentran ubicadas a 50km de la ciudad balnearia Las grutas ,no son las más grandes del país pero si son las más profundas en sus 35 km de extensión, por tener 7 metros, es la tercera en importancia de uso industrial, repleta de historias que relatan que al sur de este predio a unos 60km a posee uno de los portales al infierno, llamado Salamanca ,por los mapuches, un portal que muchos han visto, y que según los relatos se ilumina por las noches llamando a las almas pecadoras para que vendan su alma, como lo hizo Bernabé lucero, un gaucho del cual se reían por lo mal que tocaba la guitarra, se fue un día caminando por las salinas y desapareció por 6 días, al regresar tocaba como un profesional y nadie podía creerlo, pues dicen que en esos seis días el estuvo en la Salamanca.
Dicen que por las noches se escuchan sonar en esas salinas las guitarras del infierno, llamando a esas almas pecadoras.
Gracias @triton.lg y @martinchomendez por la increíble manera de compartir data y de llevar la excursión en este zarpado lugar.
